"""# Lineer Regresyon"""

from sklearn.linear_model import LinearRegression

lr = LinearRegression() # lineer regresyon algoritmasi nesnesi

lr.fit(x_train, y_train) # bunlari ogren aralarinda bag kur

x_train = x_train.sort_index() # gorsellestirme icin sirala
y_train = y_train.sort_index()
x_test = x_test.sort_index()

tahmin = lr.predict(x_test) # y testi tahmin et

plt.scatter(x_train, y_train)
plt.plot(x_test, tahmin, color = 'r')
plt.title('x - y\nAylar - Satislar')
plt.xlabel('x - Aylar')
plt.ylabel('y - Satislar')